/*Table structure for table `am_group_role` */

DROP TABLE IF EXISTS `am_group_role`;

CREATE TABLE `am_group_role` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `group_id` varchar(36) NOT NULL,
  `role_id` varchar(36) NOT NULL,
  `scope_type` varchar(30) NOT NULL COMMENT '范围：tenant、domain',
  `scope_id` varchar(36) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `group_id` (`group_id`) USING BTREE,
  KEY `role_id` (`role_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `am_group_role` */

/*Table structure for table `am_login_history` */

DROP TABLE IF EXISTS `am_login_history`;

CREATE TABLE `am_login_history` (
  `id` varchar(36) NOT NULL,
  `uid` varchar(36) NOT NULL,
  `login_ip` varchar(32) DEFAULT NULL,
  `login_address` varchar(30) DEFAULT NULL,
  `login_time` datetime NOT NULL COMMENT '登录时间',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `am_login_history` */

/*Table structure for table `am_operation_audit` */

DROP TABLE IF EXISTS `am_operation_audit`;

CREATE TABLE `am_operation_audit` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `name` varchar(255) NOT NULL COMMENT '操作名称',
  `uid` varchar(36) NOT NULL COMMENT '用户id',
  `login_name` varchar(50) NOT NULL COMMENT '登陆账号',
  `login_vdc_id` varchar(36) DEFAULT NULL COMMENT '租户id',
  `login_vdc_name` varchar(64) DEFAULT NULL COMMENT '租户名称',
  `ctime` datetime NOT NULL COMMENT '记录时间',
  `is_resource` char(1) NOT NULL,
  `object_id` varchar(36) DEFAULT NULL COMMENT '操作对象id',
  `resource_name` varchar(255) DEFAULT NULL COMMENT '资源名称',
  `resource_type` varchar(30) DEFAULT NULL COMMENT '资源类型',
  `result` varchar(150) NOT NULL COMMENT '结果',
  `remote_ip` varchar(50) NOT NULL COMMENT '远程IP地址',
  `remote_addr` varchar(50) NOT NULL COMMENT '远程地域地址（如济南、青岛）',
  `server_ip` varchar(50) NOT NULL COMMENT '当前服务器IP地址',
  `server_name` varchar(100) NOT NULL COMMENT '当前服务器名称',
  `url_id` varchar(36) DEFAULT NULL,
  `regist_url` varchar(255) DEFAULT NULL,
  `request_url` varchar(255) DEFAULT NULL,
  `request_method` varchar(10) DEFAULT NULL,
  `request_body` varchar(10000) DEFAULT NULL,
  `query_string` varchar(2000) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `vdc_id_index` (`login_vdc_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

