/*Table structure for table `am_organ` */

DROP TABLE IF EXISTS `am_organ`;

CREATE TABLE `am_organ` (
  `id` varchar(36) NOT NULL COMMENT '即organId',
  `organ_name` varchar(100) NOT NULL,
  `seq` int(3) NOT NULL DEFAULT '0' COMMENT '顺序号，展示时可根据该值由小到大排列。',
  `parent_organ_id` varchar(36) NOT NULL COMMENT 'parent_organ_id是root的节点是根节点，允许存在多个根节点',
  `created_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `am_organ` */

/*Table structure for table `am_role` */

DROP TABLE IF EXISTS `am_role`;

CREATE TABLE `am_role` (
  `id` varchar(36) NOT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `role_name` varchar(50) DEFAULT NULL,
  `role_type` varchar(10) DEFAULT NULL COMMENT '角色类型（default：系统内置角色，通过界面不允许编辑）',
  `role_desc` varchar(100) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `role_name` (`role_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `am_role` */

insert  into `am_role`(`id`,`reference_id`,`role_name`,`role_type`,`role_desc`,`created_at`) values ('admin',NULL,'admin','default','遗留角色（OS），不具备任何权限',NULL),('auditadmin',NULL,'auditadmin','default','审计管理员',NULL),('securityadmin',NULL,'securityadmin','default','安全管理员',NULL),('sysadmin',NULL,'systemadmin','default','系统管理员',NULL),('tenantadmin',NULL,'tenant','default','VDC用户',NULL);

/*Table structure for table `am_role_function_item` */

