  PRIMARY KEY (`id`),
  UNIQUE KEY `role_id` (`role_id`,`function_item_id`) USING BTREE,
  KEY `menu_item_id` (`function_item_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

