/*Table structure for table `am_url` */

DROP TABLE IF EXISTS `am_url`;

CREATE TABLE `am_url` (
  `id` varchar(32) NOT NULL,
  `url_name` varchar(100) DEFAULT NULL COMMENT 'url名称、描述',
  `is_public` char(1) NOT NULL COMMENT '1对外开放，0不对外开放',
  `url_address` varchar(150) NOT NULL,
  `method` varchar(50) NOT NULL COMMENT 'method为post、get、delete、put',
  `endpoint_id` varchar(36) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `id_express` varchar(150) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `endpoint_id` (`endpoint_id`) USING BTREE
