/*Table structure for table `am_user` */

DROP TABLE IF EXISTS `am_user`;

CREATE TABLE `am_user` (
  `id` varchar(36) NOT NULL COMMENT '即 uid',
  `reference_id` varchar(36) DEFAULT NULL,
  `user_type` varchar(10) DEFAULT NULL COMMENT '用户类型（10 系统管理员；20 租户下的用户）',
  `true_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `login_name` varchar(50) NOT NULL,
  `password` varchar(70) NOT NULL,
  `status` varchar(15) NOT NULL COMMENT 'delete 已删除、normal 正常、locked 已锁定、disabled已禁用，禁用的账号需要管理员手动来启用，锁定的账号可以自行解锁',
  `phone` varchar(15) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `create_at` datetime DEFAULT NULL COMMENT '创建时间',
  `domain_id` varchar(32) DEFAULT NULL,
  `default_vdc_id` varchar(64) DEFAULT NULL,
  `organ_id` varchar(36) DEFAULT NULL COMMENT '所属组织ID',
  `login_failed_num` tinyint(1) NOT NULL DEFAULT '0',
  `unlock_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `domain_id` (`domain_id`) USING BTREE,
  KEY `default_project_id` (`default_vdc_id`) USING BTREE,
  KEY `organ_id` (`organ_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

