/*Table structure for table `cae_app_configuration` */

DROP TABLE IF EXISTS `cae_app_configuration`;

CREATE TABLE `cae_app_configuration` (
  `id` varchar(36) NOT NULL,
  `object_id` varchar(36) DEFAULT NULL,
  `code` varchar(255) DEFAULT NULL,
  `value` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `type` varchar(30) DEFAULT NULL,
  `level` varchar(30) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='应用配置表';

/*Data for the table `cae_app_configuration` */

/*Table structure for table `cae_app_environment` */

DROP TABLE IF EXISTS `cae_app_environment`;

CREATE TABLE `cae_app_environment` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `name` varchar(255) DEFAULT NULL,
  `app_space_id` varchar(36) DEFAULT NULL,
  `app_version_id` varchar(36) DEFAULT NULL,
  `cluser_entity_id` varchar(36) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `access_address` varchar(255) DEFAULT NULL,
  `is_domain` char(1) DEFAULT NULL,
  `domain` varchar(255) DEFAULT NULL,
  `env_type` varchar(36) DEFAULT NULL,
  `env_specification` varchar(36) DEFAULT NULL,
  `is_create_rds` char(1) DEFAULT NULL,
  `is_scaling` char(1) DEFAULT NULL,
  `is_loadbalance` char(1) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `env_scope` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='应用环境表';

/*Data for the table `cae_app_environment` */

/*Table structure for table `cae_app_space` */

DROP TABLE IF EXISTS `cae_app_space`;

CREATE TABLE `cae_app_space` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `delete_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='应用空间';

/*Data for the table `cae_app_space` */

/*Table structure for table `cae_app_version` */

DROP TABLE IF EXISTS `cae_app_version`;

CREATE TABLE `cae_app_version` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `package_type` varchar(30) DEFAULT NULL,
  `package_path` varchar(255) DEFAULT NULL,
  `version` varchar(255) DEFAULT NULL,
  `app_space_id` varchar(36) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `image_id` varchar(36) DEFAULT NULL,
  `size` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='应用程序版本';

/*Data for the table `cae_app_version` */

/*Table structure for table `em_event_type` */

DROP TABLE IF EXISTS `em_event_type`;

CREATE TABLE `em_event_type` (
  `id` varchar(36) NOT NULL COMMENT 'id',
  `code` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `resource_type_id` varchar(36) DEFAULT NULL COMMENT '标识某类资源产生这类事件',
  `category` varchar(30) DEFAULT NULL COMMENT '对事件类型的大的分类（ALARMSERVICEBASICE）',
  `level` varchar(30) DEFAULT NULL COMMENT '标记该类事件的级别，可用于判别是否可被订阅（SYSTEMADMINUSER）',
