/*Table structure for table `image_image` */

DROP TABLE IF EXISTS `image_image`;

CREATE TABLE `image_image` (
  `id` varchar(36) NOT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `virtual_env_type` varchar(30) DEFAULT NULL COMMENT '区分不同的虚拟化环境，openstack、vmware',
  `name` varchar(255) DEFAULT NULL,
  `size` bigint(20) DEFAULT NULL COMMENT 'Size of image file in bytes (READ-ONLY)',
  `status` varchar(30) NOT NULL COMMENT 'queued  标识该镜像ID已经被保留，但是镜像还未上传\r\n            saving  标识镜像正在被上传\r\n            active  标识镜像在Glance中完全可用\r\n            killed  标识镜像上传过程中出错，镜像完全不可用\r\n            deleted  删除，不再使用\r\n            pending_delete  ',
  `is_public` char(1) NOT NULL COMMENT '如果是公有的，在其它项目中可以使用此镜像',
  `created_at` datetime NOT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) NOT NULL,
  `disk_format` varchar(20) DEFAULT NULL COMMENT 'raw vhd vmdk vdi iso qcow2 aki ari ami',
  `container_format` varchar(20) DEFAULT NULL COMMENT 'Format of the container\r\n            ovf bare aki ari ami\r\n            当disk format为aki ari ami时，disk format 和container format一致',
  `checksum` varchar(32) DEFAULT NULL COMMENT 'md5 hash of image contents. (READ-ONLY)',
  `owner` varchar(255) DEFAULT NULL COMMENT 'image所属项目的id',
  `min_disk` int(11) NOT NULL,
  `min_ram` int(11) NOT NULL,
  `is_protected` char(1) DEFAULT NULL COMMENT '如果是protected  dashboard中无法进行删除操作',
  `virtual_size` bigint(20) DEFAULT NULL COMMENT 'Virtual size of image in bytes (READ-ONLY)',
  `image_type` varchar(30) DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `copy_from` varchar(255) DEFAULT NULL,
  `os_type` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `reference_id` (`reference_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `image_image` */

/*Table structure for table `image_location` */

DROP TABLE IF EXISTS `image_location`;

CREATE TABLE `image_location` (
  `id` varchar(36) NOT NULL,
  `image_id` varchar(36) NOT NULL,
  `value_data` varchar(255) NOT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `deleted` char(1) NOT NULL,
  `meta_data` varchar(255) DEFAULT NULL,
  `status` varchar(30) NOT NULL DEFAULT 'active' COMMENT 'active',
  `store_type` varchar(30) DEFAULT NULL,
  `file_name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='A set of URLs to access the image file kept in external stor';

/*Data for the table `image_location` */

/*Table structure for table `image_member` */

DROP TABLE IF EXISTS `image_member`;

CREATE TABLE `image_member` (
  `id` varchar(36) NOT NULL,
  `image_id` varchar(36) NOT NULL,
  `member` varchar(36) NOT NULL,
  `can_share` char(1) NOT NULL,
  `created_at` datetime NOT NULL,
