/*Table structure for table `mon_snmp_setting` */

DROP TABLE IF EXISTS `mon_snmp_setting`;

CREATE TABLE `mon_snmp_setting` (
  `snmp_server_id` varchar(36) DEFAULT NULL,
  `snmpMgrName` varchar(36) DEFAULT NULL,
  `snmpMgrDesc` varchar(255) DEFAULT NULL,
  `readName` varchar(36) DEFAULT NULL,
  `writeName` varchar(36) DEFAULT NULL,
  `snmpVersion` int(11) DEFAULT NULL,
  `ip` varchar(256) DEFAULT NULL,
  `port` int(11) DEFAULT NULL,
  `transType` int(11) DEFAULT NULL,
  `outTime` bigint(20) DEFAULT NULL,
  `userName` varchar(36) DEFAULT NULL,
  `authGeneric` varchar(255) DEFAULT NULL,
  `authMima` varchar(255) DEFAULT NULL,
  `privacyProtocol` varchar(255) DEFAULT NULL,
  `privMima` varchar(255) DEFAULT NULL,
  `authSalt` varchar(255) DEFAULT NULL,
  `privSalt` varchar(255) DEFAULT NULL,
  `readNameSalt` varchar(255) DEFAULT NULL,
  `writeNameSalt` varchar(255) DEFAULT NULL,
  `alarmFlag` int(11) DEFAULT NULL,
  `monitorFlag` int(11) DEFAULT NULL,
  `lan` varchar(32) DEFAULT NULL,
  `indexvalues` varchar(255) DEFAULT NULL,
  `snmpsendmaxsize` int(11) DEFAULT NULL,
  `emptysleeptime` int(11) DEFAULT NULL,
  `ve_id` varchar(36) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mon_snmp_setting` */

/*Table structure for table `msg_channel` */

DROP TABLE IF EXISTS `msg_channel`;

CREATE TABLE `msg_channel` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `code` varchar(30) DEFAULT NULL COMMENT '代码',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL COMMENT '删除时间',
  `is_deleted` char(1) DEFAULT NULL COMMENT '0 未删除 1 已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订阅方式';

