/*Table structure for table `msg_message` */

DROP TABLE IF EXISTS `msg_message`;

CREATE TABLE `msg_message` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `vdc_id` varchar(36) DEFAULT NULL COMMENT 'vdc id',
  `subscriber_type` varchar(30) DEFAULT NULL COMMENT '订阅者类型',
  `subscriber_ex` varchar(255) DEFAULT NULL COMMENT '订阅者信息： user_id, org id, qq, phone number, email and system',
  `channel_code` varchar(30) DEFAULT NULL COMMENT '接收方式id',
  `subscription_code` varchar(30) DEFAULT NULL COMMENT '订阅的代码',
  `subscription_type` varchar(30) DEFAULT NULL COMMENT '订阅类型',
  `source_id` varchar(255) DEFAULT NULL COMMENT '记录对象及父对象的id，直到根对象；用于查询',
  `source_type` varchar(255) DEFAULT NULL COMMENT '对象类型',
  `event_type` varchar(255) DEFAULT NULL COMMENT '事件类型',
  `accepter` varchar(255) DEFAULT NULL COMMENT '接收者',
  `level` varchar(30) DEFAULT NULL COMMENT '消息级别：SYSTEM、USER',
  `priority` varchar(30) DEFAULT NULL COMMENT '消息优先级',
  `category` varchar(30) DEFAULT NULL COMMENT '消息种类： basic、alarm、service',
  `routing_key` varchar(255) DEFAULT NULL COMMENT '事件发送时使用的routing key',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL COMMENT '0 未删除 1 已删除',
  `started_at` datetime DEFAULT NULL,
  `is_read` char(1) DEFAULT NULL,
  `millisecond` int(3) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `vdc_id_idx` (`vdc_id`),
  KEY `subscriber_ex_idx` (`subscriber_ex`),
  KEY `msg_ctime` (`created_at`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='消息';

