/*Table structure for table `rds_instance` */

DROP TABLE IF EXISTS `rds_instance`;

CREATE TABLE `rds_instance` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `name` varchar(255) DEFAULT NULL COMMENT '实例名称',
  `instance_type` varchar(30) NOT NULL COMMENT 'temp 临时实例,normal 普通实例',
  `parent_instance_id` varchar(36) DEFAULT NULL COMMENT '临时实例的父实例ID',
  `auto_backup` char(1) DEFAULT '0' COMMENT '是否启用自动备份 1启用，0不启用',
  `description` varchar(255) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT '0' COMMENT '是否已删除，1已删除，0未删除',
  `admin_user` varchar(100) NOT NULL COMMENT '管理员账号',
  `admin_password` varchar(100) NOT NULL COMMENT '管理员密码',
  `vdc_id` varchar(36) DEFAULT NULL,
  `metadata` text COMMENT '元数据（扩展属性）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `rds_instance` */

/*Table structure for table `rds_instance_backup` */

DROP TABLE IF EXISTS `rds_instance_backup`;

CREATE TABLE `rds_instance_backup` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `instance_id` varchar(36) NOT NULL COMMENT '关联实例ID',
  `backup_type` varchar(30) NOT NULL COMMENT 'full_backup 全量备份；incremental_backup 增量备份',
  `backup_mode` varchar(30) NOT NULL COMMENT 'automated 自动备份，manual 手动备份',
  `backup_method` varchar(30) NOT NULL COMMENT 'logical 逻辑备份，physical 物理备份',
  `backup_addr` varchar(100) NOT NULL COMMENT '备份地址',
  `size` bigint(20) NOT NULL,
  `status` varchar(30) DEFAULT NULL COMMENT '备份状态（备份中backing_up、备份完成success、备份失败failed）',
  `start_time` datetime NOT NULL COMMENT '开始备份时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束备份时间',
  `expire_time` datetime DEFAULT NULL COMMENT '过期时间，到达过期时间得备份记录会被自动清理',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `rds_instance_backup` */

/*Table structure for table `rds_instance_backup_policy` */

DROP TABLE IF EXISTS `rds_instance_backup_policy`;

CREATE TABLE `rds_instance_backup_policy` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `instance_id` varchar(36) DEFAULT NULL,
  `backup_time` datetime DEFAULT NULL COMMENT '备份时间',
  `backup_period` varchar(100) DEFAULT NULL,
  `retention_days` int(3) DEFAULT '7',
  `is_enable` char(1) NOT NULL DEFAULT '0' COMMENT '是否启用备份策略，0不启用，1启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `rds_instance_backup_policy` */

/*Table structure for table `rds_instance_connection` */

DROP TABLE IF EXISTS `rds_instance_connection`;

CREATE TABLE `rds_instance_connection` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `instance_id` varchar(36) NOT NULL COMMENT '关联实例ID',
  `subnet_id` varchar(36) NOT NULL COMMENT '所属子网ID',
  `subnet_name` varchar(255) NOT NULL COMMENT '所属子网名称',
  `domain_name` varchar(100) DEFAULT NULL COMMENT '域名',
  `ip` varchar(100) NOT NULL COMMENT 'ip',
  `port` varchar(10) NOT NULL,
  `net_type` varchar(30) NOT NULL COMMENT '网络类型private 私有，public 公有',
  `node_type` varchar(30) NOT NULL COMMENT '节点类型 proxy 代理节点，normal 普通节点',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `rds_instance_connection` */

/*Table structure for table `rm_available_zone` */

DROP TABLE IF EXISTS `rm_available_zone`;

CREATE TABLE `rm_available_zone` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `region_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `description` varchar(1024) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `admin_status` varchar(30) DEFAULT NULL,
  `aggregate_id` varchar(36) DEFAULT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='可用分区';

/*Data for the table `rm_available_zone` */

/*Table structure for table `rm_available_zone_tag` */

DROP TABLE IF EXISTS `rm_available_zone_tag`;

CREATE TABLE `rm_available_zone_tag` (
  `id` varchar(36) NOT NULL,
  `available_zone_id` varchar(36) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `code` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `rm_available_zone_tag` */

/*Table structure for table `rm_cloud_service` */

DROP TABLE IF EXISTS `rm_cloud_service`;

CREATE TABLE `rm_cloud_service` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) NOT NULL,
  `region_id` varchar(36) DEFAULT NULL,
  `service_status` varchar(30) DEFAULT NULL,
  `connector_id` varchar(36) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `admin_status` varchar(30) DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='区域，一般可以按照地区进行划分';

/*Data for the table `rm_cloud_service` */

/*Table structure for table `rm_connector` */

DROP TABLE IF EXISTS `rm_connector`;

CREATE TABLE `rm_connector` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `type` varchar(30) DEFAULT NULL COMMENT 'IOP stack、IOP Mananger、硬件连接器（snmp）',
  `protocol` varchar(30) DEFAULT NULL,
  `ip` varchar(255) DEFAULT NULL,
  `port` int(11) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `active_ip` varchar(255) DEFAULT NULL,
  `standby_ip` varchar(255) DEFAULT NULL,
  `authtoken` varchar(1024) DEFAULT NULL,
  `version` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `object_id` varchar(36) DEFAULT NULL,
  `tenant_name` varchar(30) NOT NULL DEFAULT 'admin',
  `context` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='连接器';

/*Data for the table `rm_connector` */

/*Table structure for table `rm_event` */

DROP TABLE IF EXISTS `rm_event`;

CREATE TABLE `rm_event` (
  `id` varchar(36) NOT NULL,
  `event_type` varchar(255) NOT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `tenant_id` varchar(36) DEFAULT NULL,
  `resource_type` varchar(30) DEFAULT NULL COMMENT '主题类型，比如创建云主机的时候，创建了port网卡，那么创建网卡这个事件的主题类型是云主机，主题对象主键就是云主机的主键。',
  `object_id` varchar(36) DEFAULT NULL,
  `payload` text,
  `created_at` datetime DEFAULT NULL,
  `priority` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `event_ctime` (`created_at`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='事件';

/*Data for the table `rm_event` */

/*Table structure for table `rm_host` */

DROP TABLE IF EXISTS `rm_host`;

CREATE TABLE `rm_host` (
  `id` varchar(36) NOT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `vendor` varchar(255) DEFAULT NULL,
  `unit_type` varchar(36) DEFAULT NULL,
  `machine_room` varchar(36) DEFAULT NULL,
  `rack` varchar(36) DEFAULT NULL,
  `ip` varchar(255) DEFAULT NULL,
  `hostname` varchar(255) DEFAULT NULL,
  `urn` varchar(255) DEFAULT NULL,
  `group_type` varchar(30) DEFAULT NULL,
  `cpu_info` varchar(1024) DEFAULT NULL COMMENT '{"model": ["Intel(R) Xeon(R) CPU E5-2609 v2 @ 2.50GHz"], "vendor": ["Inspur"], "topology": {"cores": 8, "threads": 8}}',
  `vcpus` int(11) DEFAULT NULL,
  `vcpu_used` int(11) DEFAULT NULL,
  `memory_mb` int(11) DEFAULT NULL,
  `memory_mb_used` int(11) DEFAULT NULL,
  `free_ram_mb` int(11) DEFAULT NULL,
  `local_gb` int(11) DEFAULT NULL,
  `local_gb_used` int(11) DEFAULT NULL,
  `free_disk_gb` int(11) DEFAULT NULL,
  `disk_available_least` int(11) DEFAULT NULL,
  `running_vms` int(11) DEFAULT NULL,
  `status` varchar(30) DEFAULT NULL,
  `admin_status` varchar(30) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `is_used` char(1) DEFAULT NULL,
  `virtual_env_type` varchar(30) DEFAULT NULL,
  `virtual_env_version` varchar(255) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `available_zone` varchar(36) DEFAULT NULL,
  `cpu_availability_factor` float DEFAULT NULL,
  `memory_availability_factor` float DEFAULT NULL,
  `host_type` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='服务器';

/*Data for the table `rm_host` */

/*Table structure for table `rm_namespace` */

DROP TABLE IF EXISTS `rm_namespace`;

CREATE TABLE `rm_namespace` (
  `id` varbinary(36) NOT NULL,
  `name` varchar(255) NOT NULL,
  `display_name` varchar(255) NOT NULL,
  `description` text,
  `visibility` varchar(30) DEFAULT NULL,
  `is_protected` char(1) DEFAULT NULL,
  `owner` varchar(36) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='命名空间';

