/*Table structure for table `rm_network_device` */

DROP TABLE IF EXISTS `rm_network_device`;

CREATE TABLE `rm_network_device` (
  `id` varchar(36) DEFAULT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `network_device_type` varchar(36) DEFAULT NULL,
  `version` varchar(255) DEFAULT NULL,
  `vendor` varchar(255) DEFAULT NULL,
  `connector_id` varchar(36) DEFAULT NULL,
  `status` varchar(30) DEFAULT NULL,
  `available_zone_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='网络设备';

/*Data for the table `rm_network_device` */

/*Table structure for table `rm_region` */

DROP TABLE IF EXISTS `rm_region`;

CREATE TABLE `rm_region` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='区域，一般可以按照地区进行划分';

/*Data for the table `rm_region` */

/*Table structure for table `rm_resource` */

DROP TABLE IF EXISTS `rm_resource`;

CREATE TABLE `rm_resource` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `type` varchar(36) DEFAULT NULL,
  `object_id` varchar(36) NOT NULL,
  `available_zone_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `referenceId` (`reference_id`),
  KEY `rm_resource_index` (`object_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='资源(抽象)';

/*Data for the table `rm_resource` */

/*Table structure for table `rm_resource_reference` */

DROP TABLE IF EXISTS `rm_resource_reference`;

CREATE TABLE `rm_resource_reference` (
  `id` varchar(36) NOT NULL,
  `type` varchar(30) DEFAULT NULL COMMENT 'volume_qos volume_type 等',
  `reference_id` varchar(36) DEFAULT NULL COMMENT '各个虚拟环境中的存储的id：',
  `object_id` varchar(36) DEFAULT NULL COMMENT 'IOP 存储的需要记录与虚拟化环境对应关系的id，可能是volume_qos_id,volume_type_id等',
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL COMMENT '0 未删除 1 已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录qos volume_type 等与多个虚拟化环境之间的关联';

/*Data for the table `rm_resource_reference` */

/*Table structure for table `rm_resource_relation` */

DROP TABLE IF EXISTS `rm_resource_relation`;

CREATE TABLE `rm_resource_relation` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `object_id` varchar(36) NOT NULL COMMENT '对象主键',
  `ref_object_id` varchar(36) NOT NULL COMMENT '被依赖对象主键',
  `description` varchar(512) DEFAULT NULL COMMENT '关系描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='资源依赖关系';

/*Data for the table `rm_resource_relation` */

/*Table structure for table `rm_resource_type` */

DROP TABLE IF EXISTS `rm_resource_type`;

CREATE TABLE `rm_resource_type` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `tag` varchar(36) DEFAULT NULL,
  `tenant_id` varchar(36) DEFAULT NULL,
  `is_system` char(1) DEFAULT NULL,
  `parent_id` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='资源类型';

