/*Table structure for table `sf_configuration` */

DROP TABLE IF EXISTS `sf_configuration`;

CREATE TABLE `sf_configuration` (
  `id` varchar(36) NOT NULL,
  `template_configuration_id` varchar(36) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `code` varchar(255) DEFAULT NULL,
  `value` varchar(1024) DEFAULT NULL,
  `group_id` varchar(36) DEFAULT NULL,
  `type` varchar(30) DEFAULT NULL,
  `order_num` int(11) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  `is_history` char(1) DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  `user_id` varchar(36) DEFAULT NULL,
