  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `entity_id` varchar(36) DEFAULT NULL,
  `definition_id` varchar(36) DEFAULT NULL,
  `manage_level` varchar(30) DEFAULT NULL,
  `view_level` varchar(30) DEFAULT NULL,
  `is_required` char(1) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sf_configuration_entity_index` (`entity_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

