/*Table structure for table `sf_node_entity` */

DROP TABLE IF EXISTS `sf_node_entity`;

CREATE TABLE `sf_node_entity` (
  `id` varchar(36) NOT NULL,
  `node_group_entity_id` varchar(36) DEFAULT NULL,
  `instance_id` varchar(36) DEFAULT NULL,
  `instance_name` varchar(255) DEFAULT NULL,
  `floating_ip` varchar(255) DEFAULT NULL,
  `management_ip` varchar(255) DEFAULT NULL,
  `status` varchar(30) DEFAULT NULL,
  `user_id` varchar(36) DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  `action_status` varchar(40) DEFAULT NULL,
  `is_scaling` char(1) DEFAULT NULL,
  `scale_status` varchar(30) DEFAULT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `hostname` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sf_node_entity` */

/*Table structure for table `sf_node_entity_volume` */

DROP TABLE IF EXISTS `sf_node_entity_volume`;

CREATE TABLE `sf_node_entity_volume` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `size` int(11) DEFAULT NULL COMMENT '磁盘大小',
  `node_entity_id` varchar(36) DEFAULT NULL COMMENT '节点id',
  `volume_id` varchar(36) DEFAULT NULL COMMENT '磁盘id',
  `instance_id` varchar(36) DEFAULT NULL COMMENT '实例id',
  `attachment_id` varchar(36) DEFAULT NULL COMMENT '挂载id',
  `mountpoint` varchar(255) DEFAULT NULL COMMENT '挂载点',
  `mountpath` varchar(255) DEFAULT NULL COMMENT '挂载路径',
  `deleted_at` datetime DEFAULT NULL COMMENT '删除时间',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `is_deleted` char(1) DEFAULT NULL COMMENT '是否删除',
  `order_num` int(11) DEFAULT NULL,
  `status` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='实例扩展磁盘';

/*Data for the table `sf_node_entity_volume` */

/*Table structure for table `sf_node_group_entity` */

DROP TABLE IF EXISTS `sf_node_group_entity`;

CREATE TABLE `sf_node_group_entity` (
  `id` varchar(36) NOT NULL,
  `cluster_entity_id` varchar(36) DEFAULT NULL,
  `template_id` varchar(36) DEFAULT NULL,
  `service_definition_id` varchar(36) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `status` varchar(30) DEFAULT NULL,
  `security_groups` varchar(255) DEFAULT NULL,
  `availability_zone` varchar(255) DEFAULT NULL,
  `floating_ip_pool` varchar(36) DEFAULT NULL,
  `image_id` varchar(36) DEFAULT NULL,
  `flavor_id` varchar(36) DEFAULT NULL,
  `user_id` varchar(36) DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  `max_num` int(11) DEFAULT NULL,
  `min_num` int(11) DEFAULT NULL,
  `is_scaling` char(1) DEFAULT NULL,
  `action_status` varchar(40) DEFAULT NULL,
  `scale_out_num` int(11) DEFAULT NULL,
  `scale_in_num` int(11) DEFAULT NULL,
  `scaling_group_id` varchar(36) DEFAULT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `image_name` varchar(255) DEFAULT NULL,
  `flavor_name` varchar(255) DEFAULT NULL,
  `display_name` varchar(258) DEFAULT NULL,
  `volume_size` varchar(30) DEFAULT NULL,
  `volume_num` int(11) DEFAULT NULL,
  `volume_mountpaths` varchar(255) DEFAULT NULL,
  `order_num` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

