/*Table structure for table `sf_service_action` */

DROP TABLE IF EXISTS `sf_service_action`;

CREATE TABLE `sf_service_action` (
  `id` varchar(36) NOT NULL,
  `action` varchar(255) DEFAULT NULL COMMENT '名称',
  `service_id` varchar(36) DEFAULT NULL COMMENT '服务实例ID',
  `node_group_id` varchar(36) DEFAULT NULL COMMENT '节点组ID',
  `node_id` varchar(36) DEFAULT NULL COMMENT '节点ID',
  `server_id` varchar(36) DEFAULT NULL COMMENT '云主机实例ID',
  `request_id` varchar(36) DEFAULT NULL COMMENT '本次脚本执行的请求标识ID',
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `result` text COMMENT '脚本执行结果',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `user_id` varchar(36) DEFAULT NULL COMMENT '用户ID',
  `vdc_id` varchar(36) DEFAULT NULL COMMENT '虚拟数据中心ID',
  `status` varchar(30) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='服务脚本执行情况';

/*Data for the table `sf_service_action` */

/*Table structure for table `sf_service_command` */

DROP TABLE IF EXISTS `sf_service_command`;

CREATE TABLE `sf_service_command` (
  `id` varchar(36) NOT NULL,
  `parent_id` varchar(36) DEFAULT NULL,
  `times` int(11) DEFAULT NULL,
  `request_id` varchar(36) DEFAULT NULL,
  `code` int(11) DEFAULT NULL,
  `result` text,
  `commands` text,
  `start_at` datetime DEFAULT NULL,
  `end_at` datetime DEFAULT NULL,
  `cluster_id` varchar(36) DEFAULT NULL,
  `node_group_id` varchar(36) DEFAULT NULL,
  `component_id` varchar(36) DEFAULT NULL,
  `server_id` varchar(36) DEFAULT NULL,
  `command_name` varchar(255) DEFAULT NULL,
  `type` varchar(36) DEFAULT NULL,
  `status` varchar(30) DEFAULT NULL,
  `user_id` varchar(36) DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sf_service_command_request_index` (`request_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sf_service_command` */

/*Table structure for table `sf_service_command_result` */

DROP TABLE IF EXISTS `sf_service_command_result`;

CREATE TABLE `sf_service_command_result` (
  `id` varchar(36) NOT NULL,
  `command_id` varchar(36) DEFAULT NULL,
  `request_id` varchar(36) DEFAULT NULL,
  `code` int(11) DEFAULT NULL,
  `console` text,
  `cluster_id` varchar(36) DEFAULT NULL,
  `node_group_id` varchar(36) DEFAULT NULL,
  `component_id` varchar(36) DEFAULT NULL,
  `server_id` varchar(36) DEFAULT NULL,
  `command_name` varchar(255) DEFAULT NULL,
  `type` varchar(36) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `request_id_index` (`request_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

