/*Table structure for table `sf_service_data` */

DROP TABLE IF EXISTS `sf_service_data`;

CREATE TABLE `sf_service_data` (
  `id` varchar(36) NOT NULL,
  `service_id` varchar(36) DEFAULT NULL,
  `resource_id` varchar(36) DEFAULT NULL,
  `meter_id` varchar(36) DEFAULT NULL,
  `meter_name` varchar(255) DEFAULT NULL,
  `value` varchar(255) DEFAULT NULL,
  `unit` varchar(255) DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `display_name` varchar(255) DEFAULT NULL,
  `type` varchar(30) DEFAULT NULL,
  `order_num` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sf_service_index` (`resource_id`,`meter_id`),
  KEY `sf_service_data_service_index` (`service_id`),
  KEY `sf_service_data_resource_index` (`resource_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

