insert  into `sf_service_definition`(`id`,`type`,`version`,`name`,`package_path`,`description`,`deleted_at`,`updated_at`,`created_at`,`is_deleted`,`status`,`logo_url`,`display_name`) values ('112865b4503045e29cf2ba706b4fa676',NULL,'v2.4.6','ApachePhp','ApachePhp','集成软件：Apache2.4.6、PHP5.4.16',NULL,'2016-05-04 10:39:27','2016-01-13 17:19:28','0','EDIT','images/services/service-12.jpg','PHP运行环境（Centos7 64位 | PHP5.4 | Apache）'),('1f3be53abf42436aa86afd8e77e81412',NULL,'3.0.6','Redis','Redis','Redis服务可以为您提供高性能的缓存集群。一个集群包含多个缓存节点，支持主从、多主多从架构。',NULL,'2016-05-23 16:57:48','2016-01-09 16:52:52','0','PUBLISH','images/services/service-9.jpg','分布式缓存（Redis）'),('3dbbe3caa1eb4dcba399f6d1e72cd66f',NULL,'0.8','EMR','EMR','EMR是构建于云主机服务之上，利用开源大数据生态系统，包括Hadoop和Spark，为用户提供集群、作业、数据等管理的一站式大数据处理分析服务。',NULL,'2016-05-24 15:58:40','2016-01-25 15:42:16','0','PUBLISH','images/services/service-4.jpg','大数据EMR'),('52e61dc835ff4575b031495709879ee9',NULL,'0.10.0','Storm','Storm','Storm是一个分布式的、容错的实时计算系统，遵循Eclipse Public License 1.0,Storm可以方便地在一个计算机集群中编写与扩展复杂的实时计算。',NULL,'2016-05-10 16:33:59','2016-01-30 10:50:44','0','PUBLISH','images/services/service-5.jpg','流计算服务（Storm）'),('5a3d240aa33f4c4a90e6667d7f5fec6b',NULL,'9.4.5','postgresql','postgresql','PostgreSQL is the world\'s most advanced database system, with a global community of thousands of users and contributors and dozens of companies and organizations.',NULL,'2016-05-24 15:41:09','2016-01-14 13:56:39','0','PUBLISH','images/services/service-1.jpg','postgresql-9.4.5'),('7ad7802337104f48925c89455a890285',NULL,'0.8','Hbase','Hbase','Hbase是运行在Hadoop上的KV数据库，它是一个分布式的和可扩展的大数据仓库',NULL,'2016-05-23 10:32:53','2016-03-23 10:08:10','0','PUBLISH','images/services/service-16.jpg','Hbase'),('8024a95ffb4647e7955c691c03ae93e1',NULL,'0.8.2.2','kafka','kafka','分布式消息总线服务为您提供一个完全隔离的、分布式的、面向海量数据并基于发布-订阅模式的消息总线服务实例，服务主要包括分布式集群、多副本、自动负载均衡、监控报警、安全管理等各种管理功能。目前主要支持0.8.2.2版本的Kafka，并提供具备不同容量和性能的服务规格，您可以根据自己的业务量创建相应的分布式消息总线服务实例。',NULL,'2016-05-12 19:30:39','2016-01-25 15:41:28','0','EDIT','images/services/service-20.jpg','分布式消息总线（Kafka）'),('802583f2b3844fa5b7fb780dd0589b99',NULL,'v1.0','Haproxy','Haproxy','使用Haproxy提供4层和7层的负载均衡代理服务',NULL,'2016-05-20 17:03:32','2016-04-13 13:49:52','0','PUBLISH','images/services/service-20.jpg','Haproxy'),('94bad0ef4ee14326a5e99093d0493c61',NULL,'7.0.65','TomcatCluster','TomcatCluster','Tomcat集群服务，采用前段负载均衡，为用户提供一个可水平扩展的应用中间件服务。',NULL,'2016-05-20 09:05:40','2016-01-09 17:02:16','0','PUBLISH','images/services/service-8.jpg','Tomcat7'),('96097296892948d5981ff90c9d500271',NULL,'v10.0.21','MariaDBCluster','MariaDBCluster','RDS服务为您提供一个完全隔离的关系型数据库实例，服务包括多主节点，自动备份，监控告警、数据库管理、安全管理等各种管理功能。目前主要支持MariaDb版本的Mysql，并提供具备不同容量和性能的服务规格，您可以根据自己的业务量创建相应的关系数据库服务实例。',NULL,'2016-05-24 17:20:48','2016-01-09 15:12:05','0','PUBLISH','images/services/service-1.jpg','MySQL多主'),('a759d78fc4834178a9798ad273b3a4d0','大数据服务','2.6.0','hadoop','hadoop','hadoop大数据',NULL,'2016-04-06 10:51:12','2015-09-11 15:29:38','0','EDIT','','hadoop'),('aa377c8a11e641a6b93fb7d8214ddaa5',NULL,'3.6','RabbitMQ','RabbitMQ','消息队列服务RabbitMQ，具备分布式、高可用HA等特性。',NULL,'2016-05-09 15:31:08','2016-01-22 16:37:33','0','PUBLISH','images/services/service-3.jpg','消息队列（RabbitMQ）'),('b62db724cd2346bdbe7981915c3346de',NULL,'5.3.2','Solr','Solr','SolrCloud是基于ZooKeeper和Solr的分布式解决方案，为Solr添加分布式功能，用于建立高可用，高伸缩，自动容错，分布式索引，分布式查询的Solr服务器集群。',NULL,'2016-05-10 13:58:50','2016-02-03 15:51:31','0','PUBLISH','images/services/service-7.jpg','云搜索服务（SolrCloud）');

