/*Table structure for table `vcc_vm` */

DROP TABLE IF EXISTS `vcc_vm`;

CREATE TABLE `vcc_vm` (
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `display_description` varchar(255) DEFAULT NULL,
  `reference_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `user_id` varchar(36) DEFAULT NULL,
  `vdc_id` varchar(36) DEFAULT NULL,
  `image_ref` varchar(255) DEFAULT NULL,
  `availability_zone` varchar(255) DEFAULT NULL,
  `launch_index` int(11) DEFAULT NULL,
  `key_name` varchar(255) DEFAULT NULL,
  `key_data` varchar(1024) DEFAULT NULL,
  `power_state` varchar(30) DEFAULT NULL COMMENT 'NOSTATE = 0x00\r\n            RUNNING = 0x01\r\n            BLOCKED = 0x02\r\n            PAUSED = 0x03\r\n            SHUTDOWN = 0x04\r\n            SHUTOFF = 0x05\r\n            CRASHED = 0x06\r\n            SUSPENDED = 0x07\r\n            FAILED = 0x08\r\n            BUILDING = 0x09"',
  `vm_state` varchar(30) DEFAULT NULL COMMENT 'ACTIVE = ''active''\r\n            BUILDING = ''building''\r\n            REBUILDING = ''rebuilding''\r\n            PAUSED = ''paused''\r\n            SUSPENDED = ''suspended''\r\n            RESCUED = ''rescued''\r\n            DELETED = ''deleted''\r\n            STOPPED = ''stopped''\r\n            MIGRATING = ''migrating''\r\n            RESIZING = ''resizing''\r\n            ERROR = ''error''',
  `memory_mb` int(11) DEFAULT NULL,
  `vcpus` int(11) DEFAULT NULL,
  `scheduled_at` datetime DEFAULT NULL,
  `launched_at` datetime DEFAULT NULL,
  `terminated_at` datetime DEFAULT NULL,
  `is_locked` char(1) DEFAULT NULL,
  `vm_type_id` varchar(36) DEFAULT NULL,
  `root_device_name` varchar(255) DEFAULT NULL,
  `task_state` varchar(30) DEFAULT NULL COMMENT '执行完成后，字段中的数据为空\r\n            SCHEDULING = ''scheduling''\r\n            BLOCK_DEVICE_MAPPING = ''block_device_mapping''\r\n            NETWORKING = ''networking''\r\n            SPAWNING = ''spawning''\r\n            IMAGE_SNAPSHOT = ''image_snapshot''\r\n            IMAGE_BACKUP = ''image_backup''\r\n            UPDATING_PASSWORD = ''updating_password''\r\n            RESIZE_PREP = ''resize_prep''\r\n            RESIZE_MIGRATING = ''resize_migrating''\r\n            RESIZE_MIGRATED = ''resize_migrated''\r\n            RESIZE_FINISH = ''resize_finish''\r\n            RESIZE_REVERTING = ''resize_reverting''\r\n            RESIZE_CONFIRMING = ''resize_confirming''\r\n            RESIZE_VERIFY = ''resize_verify''\r\n            REBUILDING = ''rebuilding''\r\n            REBOOTING = ''rebooting''\r\n            PAUSING = ''pausing''\r\n            UNPAUSING = ''unpausing''\r\n            SUSPENDING = ''suspending''\r\n            RESUMING = ''resuming''\r\n            RESCUING = ''rescuing''\r\n            UNRESCUING = ''unrescuing''\r\n            DELETING = ''deleting''\r\n            STOPPING = ''stopp',
  `default_ephemeral_device` varchar(255) DEFAULT NULL,
  `default_swap_device` varchar(255) DEFAULT NULL,
  `is_auto_disk_config` char(1) DEFAULT NULL COMMENT '是否自动配置硬盘到flavor指定的大小\r\n            自动创建的虚机，该值均为0',
  `root_gb` int(11) DEFAULT NULL,
  `ephemeral_gb` int(11) DEFAULT NULL,
  `cell_name` varchar(255) DEFAULT NULL,
  `node` varchar(255) DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `locked_by` varchar(30) DEFAULT NULL COMMENT 'enum(''owner'',''admin'')',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `fixed_ips` varchar(255) DEFAULT NULL,
  `floating_ips` varchar(255) DEFAULT NULL,
  `hostname` varchar(255) DEFAULT NULL,
  `host` varchar(255) DEFAULT NULL,
  `is_ha` char(1) DEFAULT NULL,
  `swap_gb` int(11) DEFAULT NULL,
  `error_message` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

