/*Table structure for table `vmware_port` */

DROP TABLE IF EXISTS `vmware_port`;

CREATE TABLE `vmware_port` (
  `vdc_id` varchar(36) DEFAULT NULL,
  `network_id` varchar(36) DEFAULT NULL,
  `id` varchar(36) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `mac_address` varchar(32) DEFAULT NULL,
  `device_id` varchar(32) DEFAULT NULL,
  `device_owner` varchar(255) DEFAULT NULL,
  `status` varchar(16) DEFAULT NULL COMMENT '表示Port当前的运行状态。在创建Port时status默认为DOWN。此属性不能通过API修改。OVS agent在port创建后会将status设置成与admin_state_up一直的状态(ACTIVE or DOWN)。在此之前OVS agent根据admin_state_up设置其临时状态为BUILD或者DOWN。status共具有ACTIVE，DOWN，BUILD，ERROR四种状态，ML2 & OVS agent没有用到ERROR。',
  `admin_state_up` char(1) DEFAULT NULL COMMENT '表示Port的管理状态，如果设置为False，则该端口将不再转发网络包。代码中具体做法是，当Port的admin_state_up变为False时，OVS agent会将对应的OVS port的local vlan id会被设置为4095，并且在br-int上增加flow规则drop所有这个port收到网络包。',
  `is_deleted` char(1) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='vmware 端口';

/*Data for the table `vmware_port` */

