CREATE TABLE `vpc_network` (
  `vdc_id` varchar(36) DEFAULT NULL,
  `virtual_env_id` varchar(36) DEFAULT NULL,
  `id` varchar(36) NOT NULL,
  `reference_id` varchar(36) NOT NULL,
  `cidr` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `status` varchar(16) DEFAULT NULL COMMENT '表示Network的运行状态，亦即Network的实际状态。在创建Network时status默认为ACTIVE。Neutron中对Network的status属性定义了ACTIVE，BUILD，DOWN和ERROR四个状态，对于ML2 + OVS agent，目前只有ACTIVE被用到。status属性无法通过API进行修改。',
  `admin_state_up` char(1) DEFAULT NULL COMMENT '表示Network的管理状态，如果设置为False，则网络不再转发IP包。在创建网络的时候这个属性的值默认为True. 管理员可以通过API来修改admin_state_up(True|False).',
  `shared` char(1) DEFAULT NULL,
  `is_external_network` char(1) DEFAULT NULL,
  `is_deleted` char(1) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `virtual_env_type` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='网络：只有外部网络默认共享，租户网络不共享；外部网络池不与租户绑定，外网ip可分配给租户，受外网IP配额限制\r\n                                -&#&';

/*Data for the table `vpc_network` */

